import React from "react";

function CreateUser({username, email, onChange, onCreate, onDelete}) {

    return (
        <>
         <input
        name="username"
        placeholder="계정명"
        onChange={onChange}
        value={username}
      />
      <input
        name="email"
        placeholder="이메일"
        onChange={onChange}
        value={email}
      />
      <button onClick={onCreate}>등록</button>

      <button onClick={onDelete}>삭제</button> 
        
        </>
    )
}

export default CreateUser;
